import logo from "./logo.svg";
import "./App.css";
import InputGroup from "react-bootstrap/InputGroup";
import FormControl from "react-bootstrap/FormControl";
import Button from "react-bootstrap/Button";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Zoom Transcriber</h1>
        <div className="inputs">
          <InputGroup className="z-link">
            <InputGroup.Prepend>
              <InputGroup.Text id="basic-addon1">ðŸ”—</InputGroup.Text>
            </InputGroup.Prepend>
            <FormControl
              placeholder="Zoom Link"
              aria-label="Zoom Link"
              aria-describedby="basic-addon1"
            />
          </InputGroup>
          <p className="or">or</p>
          <Button className="upload" variant="secondary">
            Upload .mp4 from Computer
          </Button>{" "}
        </div>
        <Button className="transcribe" variant="success">
          Transcribe
        </Button>
      </header>
    </div>
  );
}

export default App;
